import React from "react";

function Beans() {
  async function fetchData() {
    try {
      let res = await fetch(
        "  https://jelly-belly-wiki.netlify.app/beans          "
      );
      res1 = res.json();
    } catch (error) {}
  }

  return <div>Beans</div>;
}

export default Beans;
